import logo from './logo.svg';
import './App.css';
import React, {Component} from 'react'; 

class App extends Component {
  constructor(){
    super();
    this.state={string:'Hello Mayte'};
  }
  render(){
    return(
      <div className='App'>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello Mayte
        </p>
        <button onClick={() => this.setState({string: 'Hello David'})}>Change Text</button>
      </header>
    </div>
    );
  }

}

export default App;
